import React, { Component } from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="container">
      <div className="row">
        <div className="col-md-12 text-right">
          <Link to="/add" className="btn btn-outline-dark">
            Add Emplyee
          </Link>
        </div>
        <div className="col-md-6 mx-auto">
          <h1>Welcome!</h1>
        </div>
      </div>
    </div>
  );
};

export default Home;
